import { useEffect, useState } from "react"

function Movie_board(props){
    const [data,setData] =  useState(null)
    useEffect (() => {
        fetch('/movies')
        .then(res => res.json())
        .then(result => setData(result))
        .catch((err) => {console.log(err)})
    },[data])
    
    
    return(<>
    {
        !data
        ?<h1>Loading</h1>
        :<h1> Load Succeed</h1>
    }
    </>)

}
export default Movie_board
